import React from "react";

const Contact = () => {
    return (
        <>
            <section className="header">
                <div className="container">
                    <h1 className="display-3 about_header mt-2 mb-4 text-center">
                        Contact Me
                    </h1>
                    <div className="row">
                        <div className></div>
                    </div>
                </div>
            </section>
        </>
    );
};

export default Contact;
